import './App.css';
import NavBar from 'react-bootstrap/Navbar';

function App() {
  return (
    <div className="App">
      <NavBar class="navbar bg-light">
        <div class="container-fluid">
          <a></a>
        </div>
      </NavBar>
    </div>
  );
}

export default App;
